Hey Mike - I watched the video and it looks intriguing.  Have you gotten any
light anomalies yet?  If so can you post the video of that???  I&#39;d love to
see it.

kristin



  _____  

From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf Of
M.A. Coletta (Mike)
Sent: Sunday, September 21, 2008 8:36 AM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] My ITC Instrumental TransCommunication System
Configuration



Those of you who know who I am... already know I&#39;m a geek when it comes 
to ways of putting these paranormal detector systems together.
First we had the Spiricom, then Frank&#39;s Box (Thanks to Frank Sumption), 
then the Radio Shack Hack 12-469 (Thanks to Sum Duck), then I came up 
with the Radio Shack Hack 12-470 a number of hours after Sum Duck&#39;s 12-
469, then my Mike&#39;s Box 12.470 system, and a number of other creations.
Then we had a number of individuals, right here on this EVP forum, 
discover ways of &#39;hacking&#39; other radios for that all important 
continuous sweep input. Thanks to ALL of you!

Now... I&#39;ve decided to try out a bit of ITC.
Okay... for those of you interested, I&#39;ve put out (oh no, not another 
video), yes... another video.
It can be seen at my website:
http://www.ufomagaz &lt;http://www.ufomagazine.net&gt; ine.net
or on YouTube at:
http://www.youtube. &lt;http://www.youtube.com/watch?v=3S-4e-wxd6U&gt;
com/watch?v=3S-4e-wxd6U

Thanks... and have a very paranormal day!
- Mike Coletta (UFO Geek)
Unidentified Frequency Oscillations (UFO) Magazine
UFOMagazine.net




